// React Search Filter by Lama Dev:

import React from 'react';

const App = () => {
  return (
    <>
      <div className="app">
        <input type="text" placeholder="Search..." className="search" />
        <ul className="list">
          <li className="listItem">John</li>
          <li className="listItem">Jane</li>
          <li className="listItem">Mike</li>
        </ul>
      </div>
    </>
  );
};
export default App;
